import React from "react";
import AddIcon from "@mui/icons-material/Add";

function Input() {

  const [note, setNote] = React.useState({
    title: "",
    content: "",
  });

  function handleChange() {

    const {name, value} = event.target

    setNote(prevNote => {
        return {
            ...prevNote,

        }
    })
  }

  return (
    <div className="input">
      <div>
        <input type="text" name="title" placeholder="Enter title" value={note.title} onChange={handleChange}/>
        <input type="text" name="content" placeholder="Enter content" value={note.content} onChange={handleChange}/>
      </div>
      <button>
        <AddIcon />
      </button>
    </div>
  );
}

export default Input;
